import React from 'react'
import Styled from 'styled-components';
const NewsTicker = () => {
  return (
    <Wrapper>
    <Container>
  <BigHeader className="heading"> Breaking News</BigHeader>
  <News className="textUpdate"> Some shit about digital literacy</News>
    </Container>
        </Wrapper>
  )
}
const Wrapper = Styled.div`
background:palevioletred;
display:flex;
flex-direction:rw;

`;
const Container = Styled.div`
height:10vh;
width:10vw;
position:relative;
background: papayawhip;
padding: 1vh 5vh;
padding-bottom: 4vh;
margin:2px;
justify-content: flex-start;

`;

const BigHeader = Styled.h1`
font-size: 2.5vw;
color:purple;
position:absolute;
`;
const News = Styled.p`
font-size: 1.5vw;
color:palevioletred;
position:absolute;
`;
export default NewsTicker
